package com.incomm.cca.util.export.builders.pdf;

import org.w3c.dom.Document;
import org.w3c.dom.Element;

public abstract class GenericHeaderElementBuilder extends GenericElementBuilder {

    protected Element buildLogoElement(Document document) {
        Element logoWrapper = document.createElement("div");
        logoWrapper.setAttribute("class", "logo-wrapper");
        Element logoImg = document.createElement("img");
        logoImg.setAttribute("class", "logo");
        logoImg.setAttribute("src", "data:image/jpeg;base64,");
        logoImg.setAttribute("alt", "");
        logoWrapper.appendChild(logoImg);

        return logoWrapper;
    }

    protected Element buildHeaderContentElement(Document document, String title, String subTitle, String subTitle2) {
        Element headerContentWrapper = document.createElement("div");
        headerContentWrapper.setAttribute("class", "header-content");

        Element titleElement = document.createElement("h1");
        titleElement.setAttribute("class", "text-red");
        titleElement.setTextContent(clean(title));
        headerContentWrapper.appendChild(titleElement);

        Element subTitleElement = document.createElement("h3");
        subTitleElement.setTextContent(clean(subTitle));
        headerContentWrapper.appendChild(subTitleElement);

        Element subTitle2Element = document.createElement("h4");
        subTitle2Element.setAttribute("class", "text-muted");
        subTitle2Element.setTextContent(clean(subTitle2));
        headerContentWrapper.appendChild(subTitle2Element);

        return headerContentWrapper;
    }
}
